(13, 10, 'Corona v1', '<p>COVID-19 CORONAVIRUS PANDEMIC</p>\r\n\r\n<p>Last updated: March 29, 2020, 14:51 GMT</p>\r\n\r\n<p><a href=\"https://www.worldometers.info/coronavirus/coronavirus-cases/\">Case Graphs</a>&nbsp;-&nbsp;<a href=\"https://www.worldometers.info/coronavirus/coronavirus-death-toll/\">Death Graphs</a>&nbsp;-&nbsp;<a href=\"https://www.worldometers.info/coronavirus/#countries\">Countries</a>&nbsp;-&nbsp;<a href=\"https://www.worldometers.info/coronavirus/coronavirus-death-rate/\">Death Rate</a>&nbsp;-&nbsp;<a href=\"https://www.worldometers.info/coronavirus/coronavirus-incubation-period/\">Incubation</a>&nbsp;-&nbsp;<a href=\"https://www.worldometers.info/coronavirus/coronavirus-age-sex-demographics/\">Age</a>&nbsp;-&nbsp;<a href=\"https://www.worldometers.info/coronavirus/coronavirus-symptoms/\">Symptoms</a>&nbsp;-&nbsp;<a href=\"https://www.worldometers.info/coronavirus/#news\">News</a></p>\r\n\r\n<h1>Coronavirus Cases:</h1>\r\n\r\n<p>683,937</p>\r\n\r\n<p><a href=\"https://www.worldometers.info/coronavirus/#countries\">view by country</a></p>\r\n\r\n<h1>Deaths:</h1>\r\n\r\n<p>32,164</p>\r\n\r\n<h1>Recovered:</h1>\r\n\r\n<p>146,400</p>\r\n\r\n<p>ACTIVE CASES</p>\r\n\r\n<p>505,373</p>\r\n\r\n<p>Currently Infected Patients</p>\r\n\r\n<p>479,947&nbsp;(<strong>95</strong>%)</p>\r\n\r\n<p>in Mild Condition</p>\r\n\r\n<p><br />\r\n25,426&nbsp;(<strong>5</strong>%)</p>\r\n\r\n<p>Serious or Critical</p>\r\n\r\n<p><br />\r\n<a href=\"javascript: void(0);\">Show Graph</a></p>\r\n\r\n<p>Jan 22Mar 04Jan 29Feb 05Feb 12Feb 19Feb 26Mar 11Mar 18Mar 250500k1,000k</p>\r\n\r\n<p><a href=\"javascript: void(0);\">Show Statistics</a></p>\r\n\r\n<p>CLOSED CASES</p>\r\n\r\n<p>178,564</p>\r\n\r\n<p>Cases which had an outcome:</p>\r\n\r\n<p>146,400&nbsp;(<strong>82</strong>%)</p>\r\n\r\n<p>Recovered / Discharged</p>\r\n\r\n<p><br />\r\n32,164&nbsp;(<strong>18</strong>%)</p>\r\n\r\n<p>Deaths</p>\r\n\r\n<p><br />\r\n<a href=\"javascript: void(0);\">Show Graph</a></p>\r\n\r\n<p>Feb 02Feb 07Feb 12Feb 17Feb 22Feb 27Mar 03Mar 08Mar 13Mar 18Mar 23Mar 280%100%</p>\r\n\r\n<p><a href=\"javascript: void(0);\">Show Statistics</a></p>\r\n\r\n<ul>\r\n	<li><a href=\"https://www.worldometers.info/coronavirus/#coronavirus-cases-linear\">linear</a></li>\r\n	<li><a href=\"https://www.worldometers.info/coronavirus/#coronavirus-cases-log\">logarithmic</a></li>\r\n</ul>\r\n\r\n<p>Total Coronavirus CasesTotal Cases(Linear Scale)Jan 22Jan 29Feb 05Feb 12Feb 19Feb 26Mar 04Mar 11Mar 18Mar 250200k400k600k800kCases</p>\r\n\r\n<p><a href=\"https://www.worldometers.info/coronavirus/coronavirus-cases/\"><strong>More Case Statistics</strong></a></p>\r\n\r\n<ul>\r\n	<li><a href=\"https://www.worldometers.info/coronavirus/#coronavirus-deaths-linear\">linear</a></li>\r\n	<li><a href=\"https://www.worldometers.info/coronavirus/#coronavirus-deaths-log\">logarithmic</a></li>\r\n</ul>\r\n\r\n<p>Total Coronavirus DeathsTotal Deaths(Linear Scale)Jan 22Jan 29Feb 05Feb 12Feb 19Feb 26Mar 04Mar 11Mar 18Mar 25010k20k30k40kDeathsJan 25●&nbsp;Deaths:&nbsp;56</p>\r\n\r\n<p><a href=\"https://www.worldometers.info/coronavirus/coronavirus-death-toll/\"><strong>More Death Statistics</strong></a></p>\r\n\r\n<p>The charts above are updated after the close of the day in GMT+0. Latest data is provisional, pending delayed reporting</p>', 2, 'question', '2020-03-30 15:36:38', 0),
(14, 8, 'Corona V2', '<h1>and&eacute;mie de maladie &agrave; coronavirus de 2019-2020</h1>\r\n\r\n<p><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#mw-head\">Sauter &agrave; la navigation</a><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#p-search\">Sauter &agrave; la recherche</a></p>\r\n\r\n<p><img alt=\"Icône « important »\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/f/f6/OOjs_UI_icon_alert-destructive.svg/20px-OOjs_UI_icon_alert-destructive.svg.png\" style=\"height:20px; width:20px\" /></p>\r\n\r\n<p><a href=\"https://fr.wikipedia.org/wiki/Wikip%C3%A9dia:Mise_en_garde_m%C3%A9dicale\" title=\"Wikipédia:Mise en garde médicale\"><strong>Wikip&eacute;dia ne donne pas de conseils m&eacute;dicaux ou sanitaires</strong></a>. Cet article est susceptible de contenir des informations obsol&egrave;tes ou inexactes. Seul un professionnel de sant&eacute; est apte &agrave; vous fournir un avis m&eacute;dical, et seules les autorit&eacute;s sanitaires de votre pays sont comp&eacute;tentes pour donner des consignes de sant&eacute; publique relatives &agrave; la pand&eacute;mie de Covid-19&nbsp;:&nbsp;<a href=\"https://www.gouvernement.fr/info-coronavirus\" rel=\"nofollow\">France</a><small>&nbsp;[<a href=\"http://archive.wikiwix.com/cache/?url=https%3A%2F%2Fwww.gouvernement.fr%2Finfo-coronavirus\" title=\"archive sur Wikiwix\">archive</a>]</small>,&nbsp;<a href=\"https://www.info-coronavirus.be/fr/\" rel=\"nofollow\">Belgique</a><small>&nbsp;[<a href=\"http://archive.wikiwix.com/cache/?url=https%3A%2F%2Fwww.info-coronavirus.be%2Ffr%2F\" title=\"archive sur Wikiwix\">archive</a>]</small>,&nbsp;<a href=\"https://www.canada.ca/fr/sante-publique/services/maladies/2019-nouveau-coronavirus.html\" rel=\"nofollow\">Canada</a><small>&nbsp;[<a href=\"http://archive.wikiwix.com/cache/?url=https%3A%2F%2Fwww.canada.ca%2Ffr%2Fsante-publique%2Fservices%2Fmaladies%2F2019-nouveau-coronavirus.html\" title=\"archive sur Wikiwix\">archive</a>]</small>,&nbsp;<a href=\"https://www.bag.admin.ch/bag/fr/home/krankheiten/ausbrueche-epidemien-pandemien/aktuelle-ausbrueche-epidemien/novel-cov.html\" rel=\"nofollow\">Suisse</a><small>&nbsp;[<a href=\"http://archive.wikiwix.com/cache/?url=https%3A%2F%2Fwww.bag.admin.ch%2Fbag%2Ffr%2Fhome%2Fkrankheiten%2Fausbrueche-epidemien-pandemien%2Faktuelle-ausbrueche-epidemien%2Fnovel-cov.html\" title=\"archive sur Wikiwix\">archive</a>]</small>,&nbsp;<a href=\"http://www.sante.gov.dz/coronavirus/coronavirus-2019.html\" rel=\"nofollow\">Alg&eacute;rie</a><small>&nbsp;[<a href=\"http://archive.wikiwix.com/cache/?url=http%3A%2F%2Fwww.sante.gov.dz%2Fcoronavirus%2Fcoronavirus-2019.html\" title=\"archive sur Wikiwix\">archive</a>]</small>,&nbsp;<a href=\"http://www.covidmaroc.ma/pages/Accueil.aspx\" rel=\"nofollow\">Maroc</a><small>&nbsp;[<a href=\"http://archive.wikiwix.com/cache/?url=http%3A%2F%2Fwww.covidmaroc.ma%2Fpages%2FAccueil.aspx\" title=\"archive sur Wikiwix\">archive</a>]</small>.</p>\r\n\r\n<p><a href=\"https://commons.wikimedia.org/wiki/File:Logo_R3R.svg?uselang=fr\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/4/48/Logo_R3R.svg/45px-Logo_R3R.svg.png\" style=\"height:45px; width:45px\" /></a></p>\r\n\r\n<p><strong>Les contributeurs sont tenus de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Wikip%C3%A9dia:R%C3%A8gle_des_trois_r%C3%A9vocations\" title=\"Wikipédia:Règle des trois révocations\">ne pas participer &agrave; une guerre d&rsquo;&eacute;dition</a>&nbsp;sous peine de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Wikip%C3%A9dia:Blocage_en_%C3%A9criture\" title=\"Wikipédia:Blocage en écriture\">blocage</a>.</strong></p>\r\n\r\n<p>Cette page a subi r&eacute;cemment une&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Wikip%C3%A9dia:Guerre_d%27%C3%A9dition\" title=\"Wikipédia:Guerre d\'édition\">guerre d&rsquo;&eacute;dition</a>&nbsp;au cours de laquelle plusieurs contributeurs ont mutuellement annul&eacute; leurs modifications respectives. Ce comportement non collaboratif est proscrit par la&nbsp;<strong><a href=\"https://fr.wikipedia.org/wiki/Wikip%C3%A9dia:R%C3%A8gle_des_trois_r%C3%A9vocations\" title=\"Wikipédia:Règle des trois révocations\">r&egrave;gle dite des trois r&eacute;vocations</a></strong>. En cas de d&eacute;saccord, un consensus sur la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Discussion:Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020\" title=\"Discussion:Pandémie de maladie à coronavirus de 2019-2020\">page de discussion</a>&nbsp;doit &ecirc;tre obtenu avant toute modification concernant le m&ecirc;me sujet.</p>\r\n\r\n<p><a href=\"https://fr.wikipedia.org/wiki/Aide:Homonymie\" title=\"Aide:Homonymie\"><img alt=\"Page d’aide sur l’homonymie\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/3/3e/Disambig_colour.svg/20px-Disambig_colour.svg.png\" style=\"height:15px; width:20px\" /></a></p>\r\n\r\n<p>Cet article concerne la pand&eacute;mie &agrave; coronavirus de 2019-2020. Pour la description de la maladie elle-m&ecirc;me, voir&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Maladie_%C3%A0_coronavirus_de_2019\" title=\"Maladie à coronavirus de 2019\">maladie &agrave; coronavirus de 2019</a>. Pour le coronavirus en cause, voir&nbsp;<a href=\"https://fr.wikipedia.org/wiki/SARS-CoV-2\" title=\"SARS-CoV-2\">SARS-CoV-2</a>.</p>\r\n\r\n<p><a href=\"https://commons.wikimedia.org/wiki/File:Ambox_currentevent.svg?uselang=fr\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/1/19/Ambox_currentevent.svg/45px-Ambox_currentevent.svg.png\" style=\"height:36px; width:45px\" /></a></p>\r\n\r\n<p><strong>Cet article concerne un&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Cat%C3%A9gorie:%C3%89v%C3%A9nement_en_cours\" title=\"Catégorie:Événement en cours\">&eacute;v&eacute;nement r&eacute;cent ou en cours</a>.</strong></p>\r\n\r\n<p>Ces informations peuvent manquer de recul, ne pas prendre en compte des d&eacute;veloppements r&eacute;cents ou changer &agrave; mesure que l&rsquo;&eacute;v&eacute;nement progresse. Le titre lui-m&ecirc;me peut &ecirc;tre provisoire. N&rsquo;h&eacute;sitez pas &agrave; l&rsquo;am&eacute;liorer en veillant &agrave;&nbsp;<strong><a href=\"https://fr.wikipedia.org/wiki/Wikip%C3%A9dia:Citez_vos_sources\" title=\"Wikipédia:Citez vos sources\">citer vos sources</a></strong>.<br />\r\nLa derni&egrave;re modification de cette page a &eacute;t&eacute; faite le 30 mars 2020 &agrave; 16:41.</p>\r\n\r\n<p>Pand&eacute;mie de Covid-19 de 2019-2020</p>\r\n\r\n<p><a href=\"https://commons.wikimedia.org/wiki/File:COVID-19_Outbreak_World_Map.svg?uselang=fr\"><img alt=\"COVID-19 Outbreak World Map.svg\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/2/26/COVID-19_Outbreak_World_Map.svg/260px-COVID-19_Outbreak_World_Map.svg.png\" style=\"height:134px; width:260px\" /></a></p>\r\n\r\n<p>Expansion du virus&nbsp;<a href=\"https://fr.wikipedia.org/wiki/SARS-CoV-2\" title=\"SARS-CoV-2\">SARS-CoV-2</a>&nbsp;dans le monde au&nbsp;25 mars 2020<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-Gisanddata.maps-1\">1</a>.</p>\r\n\r\n<ul>\r\n	<li>&nbsp;1 &agrave; 9&nbsp;cas&nbsp;confirm&eacute;s</li>\r\n	<li>&nbsp;10 &agrave; 99&nbsp;cas&nbsp;confirm&eacute;s</li>\r\n	<li>&nbsp;100 &agrave; 999&nbsp;cas&nbsp;confirm&eacute;s</li>\r\n	<li>&nbsp;1&nbsp;000 &agrave; 9&nbsp;999&nbsp;cas&nbsp;confirm&eacute;s</li>\r\n	<li>&nbsp;10&nbsp;000 &agrave; 99&nbsp;999&nbsp;cas&nbsp;confirm&eacute;s</li>\r\n	<li>&nbsp;Sup&eacute;rieur &agrave; 100&nbsp;000&nbsp;cas&nbsp;confirm&eacute;s</li>\r\n</ul>\r\n\r\n<p><a href=\"https://commons.wikimedia.org/wiki/File:Pandemic_photomontage_COVID-19.png?uselang=fr\"><img alt=\"Pandemic photomontage COVID-19.png\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/b/be/Pandemic_photomontage_COVID-19.png/260px-Pandemic_photomontage_COVID-19.png\" style=\"height:343px; width:260px\" /></a></p>\r\n\r\n<p>Dans le sens des aiguilles d&#39;une montre &agrave; partir du haut&nbsp;:</p>\r\n\r\n<ul>\r\n	<li>Patients hospitalis&eacute;s &agrave;&nbsp;<a href=\"https://fr.wikipedia.org/wiki/T%C3%A9h%C3%A9ran\" title=\"Téhéran\">T&eacute;h&eacute;ran</a>, en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Iran\" title=\"Iran\">Iran</a></li>\r\n	<li>V&eacute;hicules de d&eacute;sinfection &agrave;&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Taipei\" title=\"Taipei\">Taipei</a>, &agrave;&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ta%C3%AFwan\" title=\"Taïwan\">Ta&iuml;wan</a></li>\r\n	<li>Rayons vides d&#39;un supermarch&eacute; australien en raison d&#39;<a href=\"https://fr.wikipedia.org/wiki/Achat_de_panique\" title=\"Achat de panique\">achats de panique</a></li>\r\n	<li><a href=\"https://fr.wikipedia.org/wiki/S%C3%A9curit%C3%A9_sanitaire\" title=\"Sécurité sanitaire\">Contr&ocirc;les sanitaires</a>&nbsp;&agrave; l&#39;<a href=\"https://fr.wikipedia.org/wiki/A%C3%A9roport_de_Milan-Linate\" title=\"Aéroport de Milan-Linate\">a&eacute;roport de Milan-Linate</a></li>\r\n	<li>Groupe de travail du gouvernement italien sur les &eacute;pid&eacute;mies.</li>\r\n</ul>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<th scope=\"row\">Maladie</th>\r\n			<td>\r\n			<p><a href=\"https://fr.wikipedia.org/wiki/Maladie_%C3%A0_coronavirus_2019\" title=\"Maladie à coronavirus 2019\">Maladie &agrave; coronavirus 2019</a>&nbsp;(covid-19)</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Agent infectieux</th>\r\n			<td>\r\n			<p><a href=\"https://fr.wikipedia.org/wiki/SARS-CoV-2\" title=\"SARS-CoV-2\">SARS-CoV-2</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Origine</th>\r\n			<td>\r\n			<p><a href=\"https://fr.wikipedia.org/wiki/Wuhan\" title=\"Wuhan\">Wuhan</a>&nbsp;(<a href=\"https://fr.wikipedia.org/wiki/Chine\" title=\"Chine\">Chine</a>)</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Localisation</th>\r\n			<td>\r\n			<p><a href=\"https://commons.wikimedia.org/wiki/File:Crystal_Clear_app_package_network-vector.svg?uselang=fr\" title=\"Monde\"><img alt=\"Monde\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/2/22/Crystal_Clear_app_package_network-vector.svg/15px-Crystal_Clear_app_package_network-vector.svg.png\" style=\"height:15px; width:15px\" /></a>&nbsp;Monde entier&nbsp;<small>(<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020_par_pays\" title=\"Pandémie de maladie à coronavirus de 2019-2020 par pays\">liste des pays touch&eacute;s</a>)<br />\r\n			Foyers principaux (plus de 50&nbsp;000&nbsp;cas&nbsp;confirm&eacute;s)&nbsp;:</small><br />\r\n			<a href=\"https://commons.wikimedia.org/wiki/File:Flag_of_the_United_States.svg?uselang=fr\" title=\"Drapeau des États-Unis\"><img alt=\"Drapeau des États-Unis\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/a/a4/Flag_of_the_United_States.svg/20px-Flag_of_the_United_States.svg.png\" style=\"height:11px; width:20px\" /></a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/%C3%89tats-Unis\" title=\"États-Unis\">&Eacute;tats-Unis</a><br />\r\n			<a href=\"https://commons.wikimedia.org/wiki/File:Flag_of_Italy.svg?uselang=fr\" title=\"Drapeau de l\'Italie\"><img alt=\"Drapeau de l\'Italie\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/0/03/Flag_of_Italy.svg/20px-Flag_of_Italy.svg.png\" style=\"height:13px; width:20px\" /></a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Italie\" title=\"Italie\">Italie</a><br />\r\n			<a href=\"https://commons.wikimedia.org/wiki/File:Flag_of_the_People%27s_Republic_of_China.svg?uselang=fr\" title=\"Drapeau de la République populaire de Chine\"><img alt=\"Drapeau de la République populaire de Chine\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/f/fa/Flag_of_the_People%27s_Republic_of_China.svg/20px-Flag_of_the_People%27s_Republic_of_China.svg.png\" style=\"height:13px; width:20px\" /></a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Chine\" title=\"Chine\">Chine</a><br />\r\n			<a href=\"https://commons.wikimedia.org/wiki/File:Flag_of_Spain.svg?uselang=fr\" title=\"Drapeau de l\'Espagne\"><img alt=\"Drapeau de l\'Espagne\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/9/9a/Flag_of_Spain.svg/20px-Flag_of_Spain.svg.png\" style=\"height:13px; width:20px\" /></a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Espagne\" title=\"Espagne\">Espagne</a><br />\r\n			<a href=\"https://commons.wikimedia.org/wiki/File:Flag_of_Germany.svg?uselang=fr\" title=\"Drapeau de l\'Allemagne\"><img alt=\"Drapeau de l\'Allemagne\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/b/ba/Flag_of_Germany.svg/20px-Flag_of_Germany.svg.png\" style=\"height:12px; width:20px\" /></a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Allemagne\" title=\"Allemagne\">Allemagne</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Date d&#39;arriv&eacute;e</th>\r\n			<td>\r\n			<p>Depuis le&nbsp;17 novembre 2019<br />\r\n			<small>(4&nbsp;mois et 13&nbsp;jours)</small></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Site web</th>\r\n			<td>\r\n			<p>(en)&nbsp;<a href=\"https://www.who.int/emergencies/diseases/novel-coronavirus-2019\" rel=\"nofollow\">www.who.int/emergencies/diseases/novel-coronavirus-2019</a><a href=\"https://www.wikidata.org/wiki/Q81068910?uselang=fr#P973\" title=\"Voir et modifier les données sur Wikidata\"><img alt=\"Voir et modifier les données sur Wikidata\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/7/73/Blue_pencil.svg/10px-Blue_pencil.svg.png\" style=\"height:10px; width:10px\" /></a></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<caption>Bilan</caption>\r\n	<tbody>\r\n		<tr>\r\n			<th scope=\"row\">Cas confirm&eacute;s</th>\r\n			<td>\r\n			<p>735&nbsp;560</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Cas soign&eacute;s</th>\r\n			<td>\r\n			<p>156&nbsp;122</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Morts</th>\r\n			<td>\r\n			<p>34&nbsp;804</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><a href=\"https://fr.wikipedia.org/w/index.php?title=Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020&amp;veaction=edit&amp;section=0\">modifier</a>&nbsp;-&nbsp;<a href=\"https://fr.wikipedia.org/w/index.php?title=Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020&amp;action=edit&amp;section=0\">modifier le code</a>&nbsp;-&nbsp;<a href=\"https://www.wikidata.org/wiki/Q81068910\" title=\"d:Q81068910\">modifier Wikidata</a><a href=\"https://fr.wikipedia.org/wiki/Mod%C3%A8le:Infobox_Pand%C3%A9mie\" title=\"Documentation du modèle\"><img alt=\"Documentation du modèle\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/3/38/Info_Simple.svg/12px-Info_Simple.svg.png\" style=\"height:12px; width:12px\" /></a></p>\r\n\r\n<p>La&nbsp;<strong>pand&eacute;mie de maladie &agrave; coronavirus de 2019-2020</strong>&nbsp;est une&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie\" title=\"Pandémie\">pand&eacute;mie</a>&nbsp;d&#39;une&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Maladie_infectieuse_%C3%A9mergente\" title=\"Maladie infectieuse émergente\">maladie infectieuse &eacute;mergente</a>, appel&eacute;e&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Maladie_%C3%A0_coronavirus_2019\" title=\"Maladie à coronavirus 2019\">Covid-19</a>&nbsp;et provoqu&eacute;e par le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Coronavirus\" title=\"Coronavirus\">coronavirus</a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/SARS-CoV-2\" title=\"SARS-CoV-2\">SARS-CoV-2</a>, qui d&eacute;bute le&nbsp;17 novembre 2019&nbsp;dans la ville de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Wuhan\" title=\"Wuhan\">Wuhan</a>, en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Chine_centrale\" title=\"Chine centrale\">Chine centrale</a>, puis se propage dans le monde entier.</p>\r\n\r\n<p>L&#39;OMS alerte dans un premier temps la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Chine\" title=\"Chine\">r&eacute;publique populaire de Chine</a>&nbsp;et les autres membres de l&#39;OMS<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-Dec23012020-2\">2</a>, puis elle prononce l&#39;&eacute;tat d&#39;<a href=\"https://fr.wikipedia.org/wiki/Urgence_de_sant%C3%A9_publique_de_port%C3%A9e_internationale\" title=\"Urgence de santé publique de portée internationale\">urgence de sant&eacute; publique de port&eacute;e internationale</a>&nbsp;le&nbsp;30 janvier<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-Dec23012020-2\">2</a>.</p>\r\n\r\n<p>Le&nbsp;13 janvier, un premier cas est d&eacute;couvert hors de Chine continentale. Deux navires de croisi&egrave;re (le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/MS_Westerdam\" title=\"MS Westerdam\">MS&nbsp;<em>Westerdam</em></a>&nbsp;et le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Diamond_Princess_(navire_de_croisi%C3%A8re)#Coronavirus_SARS-CoV-2\" title=\"Diamond Princess (navire de croisière)\"><em>Diamond Princess</em></a>) sont aussi touch&eacute;s. Le nombre total de malades hors de la Chine d&eacute;passe les 1&nbsp;500 &agrave; la mi-f&eacute;vrier<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-bno-3\">3</a>,<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-Gisanddata.maps-1\">1</a>.</p>\r\n\r\n<p>&Agrave; partir de janvier 2020, le gouvernement chinois met en &oelig;uvre des proc&eacute;dures lourdes de confinement, et place plusieurs villes puis toute une r&eacute;gion en quarantaine, fermant de nombreux sites publics et d&eacute;ployant d&#39;importants moyens sanitaires.</p>\r\n\r\n<p>Le&nbsp;25 f&eacute;vrier, le nombre de nouveaux cas d&eacute;clar&eacute;s quotidiennement hors de Chine est plus &eacute;lev&eacute; que dans ce pays<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-4\">4</a>,<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-5\">5</a>,<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-6\">6</a>.</p>\r\n\r\n<p>Le&nbsp;11 mars 2020, l&#39;<a href=\"https://fr.wikipedia.org/wiki/%C3%89pid%C3%A9mie\" title=\"Épidémie\">&eacute;pid&eacute;mie</a>&nbsp;de covid-19<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-Note%C3%89pidemie-7\">a</a>&nbsp;devient une pand&eacute;mie<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-pand%C3%A9mie-8\">7</a>,<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-9\">8</a>&nbsp;selon l&#39;<a href=\"https://fr.wikipedia.org/wiki/Organisation_mondiale_de_la_sant%C3%A9\" title=\"Organisation mondiale de la santé\">OMS</a>, qui demande des&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Pr%C3%A9vention\">mesures de protection essentielles contre le nouveau coronavirus</a>&nbsp;pour pr&eacute;venir la saturation des services de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Unit%C3%A9_de_soins_intensifs\" title=\"Unité de soins intensifs\">soins intensifs</a><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-XiaoboAl2020Fev-10\">9</a>&nbsp;et renforcer l&#39;<a href=\"https://fr.wikipedia.org/wiki/Hygi%C3%A8ne#Hygi%C3%A8ne_pr%C3%A9ventive\" title=\"Hygiène\">hygi&egrave;ne pr&eacute;ventive</a>&nbsp;(suppression des contacts physiques, bises et serrements de mains, fin des attroupements et des grandes manifestations ainsi que des d&eacute;placements et&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Voyage\" title=\"Voyage\">voyages</a>&nbsp;non indispensables, promotion du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Hygi%C3%A8ne_des_mains\" title=\"Hygiène des mains\">lavage des mains</a>, mise en application de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Quarantaine\" title=\"Quarantaine\">quarantaine</a>,&nbsp;etc.). Cette pand&eacute;mie mondiale provoque des annulations en s&eacute;rie de manifestations sportives et culturelles sur toute la plan&egrave;te, la mise en place par de nombreux pays de mesures de confinement pour freiner la formation de nouveaux&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Foyer_de_contagion\" title=\"Foyer de contagion\">foyers de contagion</a>, la fermeture des fronti&egrave;res de nombreux pays, et un&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Krach_boursier_de_2020\" title=\"Krach boursier de 2020\">krach boursier</a>&nbsp;du fait des incertitudes et des craintes qu&#39;elle fait peser sur l&#39;&eacute;conomie mondiale. Elle a aussi des effets en termes d&#39;<a href=\"https://fr.wikipedia.org/wiki/Cons%C3%A9quences_socio-%C3%A9conomiques_de_la_pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_2019-2020\" title=\"Conséquences socio-économiques de la pandémie de maladie à coronavirus 2019-2020\">instabilit&eacute; sociale et &eacute;conomique</a>&nbsp;et est le pr&eacute;texte &agrave; la diffusion en ligne d&#39;informations erron&eacute;es ou relevant de la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Th%C3%A9orie_du_complot\" title=\"Théorie du complot\">th&eacute;orie du complot</a>.</p>\r\n\r\n<p>Le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Taux_de_l%C3%A9talit%C3%A9\" title=\"Taux de létalité\">taux de l&eacute;talit&eacute;</a>&nbsp;provisoire est plus bas que lors des pr&eacute;c&eacute;dentes &eacute;pid&eacute;mies &agrave; coronavirus<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-:6-11\">10</a>, avec pour estimation environ 1 &agrave; 2&nbsp;% sur les cas d&eacute;pist&eacute;s<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-12\">11</a>.</p>\r\n\r\n<p>Au&nbsp;30 mars, environ 735&nbsp;000 cas cumul&eacute;s sont confirm&eacute;s dans le monde, dont environ 156&nbsp;000 personnes gu&eacute;ries et 35&nbsp;000 morts<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-bno-3\">3</a>. Ce sont 199&nbsp;pays et territoires qui sont touch&eacute;s par cette&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Crise_sanitaire\" title=\"Crise sanitaire\">crise sanitaire</a>&nbsp;mondiale, avec des foyers majeurs en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020_en_Chine\" title=\"Pandémie de maladie à coronavirus de 2019-2020 en Chine\">Chine</a>, en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2020_en_Italie\" title=\"Pandémie de maladie à coronavirus de 2020 en Italie\">Italie</a>, aux&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2020_aux_%C3%89tats-Unis\" title=\"Pandémie de maladie à coronavirus de 2020 aux États-Unis\">&Eacute;tats-Unis</a>, en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2020_en_Espagne\" title=\"Pandémie de maladie à coronavirus de 2020 en Espagne\">Espagne</a>, en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2020_en_Allemagne\" title=\"Pandémie de maladie à coronavirus de 2020 en Allemagne\">Allemagne</a>, en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Iran\" title=\"Iran\">Iran</a>&nbsp;et en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2020_en_France\" title=\"Pandémie de maladie à coronavirus de 2020 en France\">France</a>. L&#39;OMS d&eacute;clare, le&nbsp;13 mars, l&#39;<a href=\"https://fr.wikipedia.org/wiki/Europe\" title=\"Europe\">Europe</a>&nbsp;&eacute;picentre de la pand&eacute;mie<a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#cite_note-13\">12</a>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Sommaire</h2>\r\n\r\n<ul>\r\n	<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Donn%C3%A9es_et_caract%C3%A9ristiques_%C3%A9pid%C3%A9miologiques\">1Donn&eacute;es et caract&eacute;ristiques &eacute;pid&eacute;miologiques</a>\r\n\r\n	<ul>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#%C3%80_propos_des_donn%C3%A9es\">1.1&Agrave; propos des donn&eacute;es</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Caract%C3%A9ristiques_%C3%A9pid%C3%A9miologiques_de_la_phase_d\'%C3%A9mergence_en_Chine\">1.2Caract&eacute;ristiques &eacute;pid&eacute;miologiques de la phase d&#39;&eacute;mergence en Chine</a></li>\r\n	</ul>\r\n	</li>\r\n	<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Virus\">2Virus</a>\r\n	<ul>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Caract%C3%A9ristiques\">2.1Caract&eacute;ristiques</a>\r\n		<ul>\r\n			<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Dur%C3%A9e_d\'infectiosit%C3%A9_du_virus\">2.1.1Dur&eacute;e d&#39;infectiosit&eacute; du virus</a></li>\r\n		</ul>\r\n		</li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Mode_de_transmission\">2.2Mode de transmission</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#P%C3%A9diatrie\">2.3P&eacute;diatrie</a></li>\r\n	</ul>\r\n	</li>\r\n	<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Maladie\">3Maladie</a>\r\n	<ul>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Sympt%C3%B4mes\">3.1Sympt&ocirc;mes</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Test_diagnostique\">3.2Test diagnostique</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Traitement_et_recommandation\">3.3Traitement et recommandation</a>\r\n		<ul>\r\n			<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Recommandations\">3.3.1Recommandations</a></li>\r\n			<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Recherches_en_cours\">3.3.2Recherches en cours</a></li>\r\n		</ul>\r\n		</li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Pr%C3%A9visions_de_diffusion_de_la_maladie\">3.4Pr&eacute;visions de diffusion de la maladie</a></li>\r\n	</ul>\r\n	</li>\r\n	<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Apparition_en_r%C3%A9publique_populaire_de_Chine\">4Apparition en r&eacute;publique populaire de Chine</a>\r\n	<ul>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Origine_animale\">4.1Origine animale</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Apparition_de_l\'%C3%A9pid%C3%A9mie\">4.2Apparition de l&#39;&eacute;pid&eacute;mie</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Propagation\">4.3Propagation</a>\r\n		<ul>\r\n			<li><a href=\"https://fr.wikipedia.org/wiki/Pand%C3%A9mie_de_maladie_%C3%A0_coronavirus_de_2019-2020#Pollution_de_l\'air_et_propagation\">4.3.1Pollution de l&#39;air et propagation</a></li>\r\n		</ul>\r\