(15, 8, 'CR7', '<h1>Cristiano Ronaldo</h1>\r\n\r\n<p><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#mw-head\">Sauter &agrave; la navigation</a><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#p-search\">Sauter &agrave; la recherche</a></p>\r\n\r\n<p><a href=\"https://fr.wikipedia.org/wiki/Aide:Homonymie\" title=\"Aide:Homonymie\"><img alt=\"Page d’aide sur l’homonymie\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/6/6f/Confusion_colour.svg/20px-Confusion_colour.svg.png\" style=\"height:15px; width:20px\" /></a></p>\r\n\r\n<p>Ne doit pas &ecirc;tre confondu avec le footballeur br&eacute;silien&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ronaldo\" title=\"Ronaldo\">Ronaldo</a>.</p>\r\n\r\n<p><a href=\"https://fr.wikipedia.org/wiki/Aide:Homonymie\" title=\"Aide:Homonymie\"><img alt=\"Page d’aide sur l’homonymie\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/3/3e/Disambig_colour.svg/20px-Disambig_colour.svg.png\" style=\"height:15px; width:20px\" /></a></p>\r\n\r\n<p>Pour les articles homonymes, voir&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ronaldo_(homonymie)\" title=\"Ronaldo (homonymie)\">Ronaldo (homonymie)</a>&nbsp;et&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Cristiano\" title=\"Cristiano\">Cristiano</a>.</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"3\">Cristiano Ronaldo</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\"><a href=\"https://commons.wikimedia.org/wiki/File:Cristiano_Ronaldo_2018.jpg?uselang=fr\" title=\"Cristiano Ronaldo avec le Portugal en 2018.\"><img alt=\"Image illustrative de l’article Cristiano Ronaldo\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/8/8c/Cristiano_Ronaldo_2018.jpg/250px-Cristiano_Ronaldo_2018.jpg\" style=\"height:375px; width:250px\" /></a><br />\r\n			Cristiano Ronaldo avec le Portugal en 2018.</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\"3\">Situation actuelle</th>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">&Eacute;quipe</th>\r\n			<td colsp