kipedia.org/wiki/M%C3%A8tre\" title=\"Mètre\">m</a>&nbsp;(6<a href=\"https://fr.wikipedia.org/wiki/Pied_(unit%C3%A9)\" title=\"Pied (unité)\">&prime;</a>&nbsp;1<a href=\"https://fr.wikipedia.org/wiki/Pouce_(unit%C3%A9)\" title=\"Pouce (unité)\">&Prime;</a>)<a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#cite_note-1\">1</a></td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">P&eacute;riode pro.</th>\r\n			<td colspan=\"2\"><a href=\"https://fr.wikipedia.org/wiki/2002_en_football\" title=\"2002 en football\">2002</a>&nbsp;-</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Poste</th>\r\n			<td colspan=\"2\"><a href=\"https://fr.wikipedia.org/wiki/Attaquant_(football)\" title=\"Attaquant (football)\">Attaquant</a></td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Pied fort</th>\r\n			<td colspan=\"2\">Droit</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\"3\">Parcours junior</th>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Ann&eacute;es</strong></td>\r\n			<td colspan=\"2\"><strong>Club</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"https://fr.wikipedia.org/wiki/1993_en_football\" title=\"1993 en football\">1993</a>-<a href=\"https://fr.wikipedia.org/wiki/1995_en_football\" title=\"1995 en football\">1995</a></td>\r\n			<td><a href=\"https://commons.wikimedia.org/wiki/File:Flag_of_Portugal.svg?uselang=fr\" title=\"Drapeau : Portugal\"><img alt=\"Drapeau : Portugal\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/5/5c/Flag_of_Portugal.svg/20px-Flag_of_Portugal.svg.png\" style=\"height:13px; width:20px\" /></a>&nbsp;FC Andorinha<a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#cite_note-2\">2</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"https://fr.wikipedia.org/wiki/1995_en_football\" title=\"1995 en football\">1995</a>-<a href=\"https://fr.wikipedia.org/wiki/1997_en_football\" title=\"1997 en football\">1997</a></td>\r\n			<td><a href=\"https://commons.wikimedia.org/wiki/File:Flag_