>Sporting CP</a></td>\r\n			<td>31&nbsp;(5)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"https://fr.wikipedia.org/wiki/2003_en_football\" title=\"2003 en football\">2003</a>-<a href=\"https://fr.wikipedia.org/wiki/2009_en_football\" title=\"2009 en football\">2009</a></td>\r\n			<td><a href=\"https://commons.wikimedia.org/wiki/File:Flag_of_England.svg?uselang=fr\" title=\"Drapeau : Angleterre\"><img alt=\"Drapeau : Angleterre\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/b/be/Flag_of_England.svg/20px-Flag_of_England.svg.png\" style=\"height:12px; width:20px\" /></a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Manchester_United_Football_Club\" title=\"Manchester United Football Club\">Manchester United</a></td>\r\n			<td>292 (118)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"https://fr.wikipedia.org/wiki/2009_en_football\" title=\"2009 en football\">2009</a>-<a href=\"https://fr.wikipedia.org/wiki/2018_en_football\" title=\"2018 en football\">2018</a></td>\r\n			<td><a href=\"https://commons.wikimedia.org/wiki/File:Flag_of_Spain.svg?uselang=fr\" title=\"Drapeau : Espagne\"><img alt=\"Drapeau : Espagne\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/9/9a/Flag_of_Spain.svg/20px-Flag_of_Spain.svg.png\" style=\"height:13px; width:20px\" /></a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Real_Madrid_Club_de_F%C3%BAtbol\" title=\"Real Madrid Club de Fútbol\">Real Madrid</a></td>\r\n			<td>438 (450)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"https://fr.wikipedia.org/wiki/2018_en_football\" title=\"2018 en football\">2018</a>-</td>\r\n			<td><a href=\"https://commons.wikimedia.org/wiki/File:Flag_of_Italy.svg?uselang=fr\" title=\"Drapeau : Italie\"><img alt=\"Drapeau : Italie\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/0/03/Flag_of_Italy.svg/20px-Flag_of_Italy.svg.png\" style=\"height:13px; width:20px\" /></a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Juventus_Football_Club\" title=\"Juventus Football Club\">Juventus FC</a></td>\r\n			<td>75&nbsp;(53)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Total</strong></td>\r\n			<td>&nbsp;</td>\r\n			<td><strong>836 (626)</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\"3\">S&eacute;lections en &eacute;quipe nationale2</th>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Ann&eacute;es</strong></td>\r\n			<td><strong>&Eacute;quipe</strong></td>\r\n			<td><strong>M.(B.)</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"https://fr.wikipedia.org/wiki/2001_en_football\" title=\"2001 en football\">2001</a></td>\r\n			<td><a href=\"https://commons.wikimedia.org/wiki/File:Flag_of_Portugal.svg?uselang=fr\" title=\"Drapeau : Portugal\"><img alt=\"Drapeau : Portugal\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/5/5c/Flag_of_Portugal.svg/20px-Flag_of_Portugal.svg.png\" style=\"height:13px; width:20px\" /></a>&nbsp;Portugal -15 ans</td>\r\n			<td>9&nbsp;(7)<a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#cite_note-transfermarkt_53807-3\">3</a>,<a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#cite_note-fpf-4\">4</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"https://fr.wikipedia.org/wiki/2001_en_football\" title=\"2001 en football\">2001</a>-<a href=\"https://fr.wikipedia.org/wiki/2002_en_football\" title=\"2002 en football\">2002</a></td>\r\n			<td><a href=\"https://commons.wikimedia.org/wiki/File:Flag_of_Portugal.svg?uselang=fr\" title=\"Drapeau : Portugal\"><img alt=\"Drapeau : Portugal\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/5/5c/Flag_of_Portugal.svg/20px-Flag_of_Portugal.svg.png\" style=\"height:13px; width:20px\" /></a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/%C3%89quipe_du_Portugal_des_moins_de_17_ans_de_football\" title=\"Équipe du Portugal des moins de 17 ans de football\">Portugal -17 ans</a></td>\r\n			<td>7&nbsp;(5)<a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#cite_note-5\">5</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"https://fr.wikipedia.org/wiki/2003_en_football\" title=\"2003 en football\">2003</a></td>\r\n			<td><a href=\"https://commons.wikimedia.org/wiki/File:Flag_of_Portugal.svg?uselang=fr\" title=\"Drapeau : Portugal\"><img alt=\"Drapeau : Portugal\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/5/5c/Flag_of_Portugal.svg/20px-Flag_of_Portugal.svg.png\" style=\"height:13px; width:20px\" /></a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/%C3%89quipe_du_Portugal_des_moins_de_20_ans_de_football\" title=\"Équipe du Portugal des moins de 20 ans de football\">Portugal -20 ans</a></td>\r\n			<td>5&nbsp;(1)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"https://fr.wikipedia.org/wiki/2002_en_football\" title=\"2002 en football\">2002</a>-<a href=\"https://fr.wikipedia.org/wiki/2003_en_football\" title=\"2003 en football\">2003</a></td>\r\n			<td><a href=\"https://commons.wikimedia.org/wiki/File:Flag_of_Portugal.svg?uselang=fr\" title=\"Drapeau : Portugal\"><img alt=\"Drapeau : Portugal\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/5/5c/Flag_of_Portugal.svg/20px-Flag_of_Portugal.svg.png\" style=\"height:13px; width:20px\" /></a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/%C3%89quipe_du_Portugal_espoirs_de_football\" title=\"Équipe du Portugal espoirs de football\">Portugal espoirs</a></td>\r\n			<td>10&nbsp;(3)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"https://fr.wikipedia.org/wiki/2004_en_football\" title=\"2004 en football\">2004</a></td>\r\n			<td><a href=\"https://commons.wikimedia.org/wiki/File:Flag_of_Portugal.svg?uselang=fr\" title=\"Drapeau : Portugal\"><img alt=\"Drapeau : Portugal\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/5/5c/Flag_of_Portugal.svg/20px-Flag_of_Portugal.svg.png\" style=\"height:13px; width:20px\" /></a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/%C3%89quipe_du_Portugal_olympique_de_football\" title=\"Équipe du Portugal olympique de football\">Portugal olympique</a></td>\r\n			<td>3&nbsp;(2)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"https://fr.wikipedia.org/wiki/2003_en_football\" title=\"2003 en football\">2003</a>-</td>\r\n			<td><a href=\"https://commons.wikimedia.org/wiki/File:Flag_of_Portugal.svg?uselang=fr\" title=\"Drapeau : Portugal\"><img alt=\"Drapeau : Portugal\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/5/5c/Flag_of_Portugal.svg/20px-Flag_of_Portugal.svg.png\" style=\"height:13px; width:20px\" /></a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/%C3%89quipe_du_Portugal_de_football\" title=\"Équipe du Portugal de football\">Portugal</a></td>\r\n			<td>164&nbsp;(99)</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\"><small>1&nbsp;Comp&eacute;titions officielles nationales et internationales.<br />\r\n			2&nbsp;Matchs officiels.<br />\r\n			Derni&egrave;re mise &agrave; jour&nbsp;: 8 mars 2020</small></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\"><a href=\"https://fr.wikipedia.org/w/index.php?title=Cristiano_Ronaldo&amp;action=edit&amp;section=0\">modifier</a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Mod%C3%A8le:Infobox_Footballeur\" title=\"Consultez la documentation du modèle\"><img alt=\"Consultez la documentation du modèle\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/3/38/Info_Simple.svg/12px-Info_Simple.svg.png\" style=\"height:12px; width:12px\" /></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Cristiano Ronaldo dos Santos Aveiro</strong>, couramment appel&eacute;&nbsp;<strong>Ronaldo</strong>&nbsp;ou&nbsp;<strong>Cristiano Ronaldo</strong>&nbsp;et surnomm&eacute;&nbsp;<strong>CR7</strong>, n&eacute; le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/5_f%C3%A9vrier_en_sport\" title=\"5 février en sport\">5 f&eacute;vrier</a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/1985_en_football\" title=\"1985 en football\">1985</a>&nbsp;&agrave;&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Funchal\" title=\"Funchal\">Funchal</a>&nbsp;sur l&#39;<a href=\"https://fr.wikipedia.org/wiki/%C3%8Ele_de_Mad%C3%A8re\" title=\"Île de Madère\">&icirc;le de Mad&egrave;re</a>, est un&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Footballeur\" title=\"Footballeur\">footballeur</a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/%C3%89quipe_du_Portugal_de_football\" title=\"Équipe du Portugal de football\">international</a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Portugal\" title=\"Portugal\">portugais</a>&nbsp;qui &eacute;volue au poste d&#39;<a href=\"https://fr.wikipedia.org/wiki/Attaquant_(football)\" title=\"Attaquant (football)\">attaquant</a>&nbsp;&agrave; la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Juventus_Football_Club\" title=\"Juventus Football Club\">Juventus de Turin</a>.</p>\r\n\r\n<p>Consid&eacute;r&eacute; comme l&#39;un des meilleurs joueurs de l&#39;histoire de son sport, il est le seul footballeur avec&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Lionel_Messi\" title=\"Lionel Messi\">Lionel Messi</a>&nbsp;&agrave; avoir remport&eacute; le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ballon_d%27or\" title=\"Ballon d\'or\">Ballon d&#39;or</a>&nbsp;au moins cinq fois&nbsp;: en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ballon_d%27or_2008\" title=\"Ballon d\'or 2008\">2008</a>,&nbsp;<a href=\"https://fr.wikipedia.org/wiki/FIFA_Ballon_d%27or_2013\" title=\"FIFA Ballon d\'or 2013\">2013</a>,&nbsp;<a href=\"https://fr.wikipedia.org/wiki/FIFA_Ballon_d%27or_2014\" title=\"FIFA Ballon d\'or 2014\">2014</a>,&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ballon_d%27or_2016\" title=\"Ballon d\'or 2016\">2016</a>&nbsp;et en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ballon_d%27or_2017\" title=\"Ballon d\'or 2017\">2017</a>. Auteur de plus de 720&nbsp;buts en carri&egrave;re, il est le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Meilleurs_buteurs_de_la_Ligue_des_champions_de_l%27UEFA\" title=\"Meilleurs buteurs de la Ligue des champions de l\'UEFA\">meilleur buteur de la Ligue des champions de l&#39;UEFA</a>, des coupes d&#39;Europe, du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Real_Madrid_Club_de_F%C3%BAtbol\" title=\"Real Madrid Club de Fútbol\">Real Madrid</a>, du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Derby_madril%C3%A8ne\" title=\"Derby madrilène\">derby madril&egrave;ne</a>, de la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Coupe_du_monde_des_clubs_de_la_FIFA\" title=\"Coupe du monde des clubs de la FIFA\">Coupe du monde des clubs de la FIFA</a>&nbsp;et de la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/%C3%89quipe_du_Portugal_de_football\" title=\"Équipe du Portugal de football\">s&eacute;lection portugaise</a>, dont il est le capitaine depuis&nbsp;<a href=\"https://fr.wikipedia.org/wiki/2007_en_football\" title=\"2007 en football\">2007</a>. Premier joueur &agrave; avoir remport&eacute; le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Soulier_d%27or_europ%C3%A9en\" title=\"Soulier d\'or européen\">Soulier d&#39;or europ&eacute;en</a>&nbsp;&agrave; quatre reprises, il est &eacute;galement le co-meilleur buteur de l&#39;histoire du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Championnat_d%27Europe_de_football\" title=\"Championnat d\'Europe de football\">championnat d&#39;Europe des nations</a>&nbsp;avec&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Michel_Platini\" title=\"Michel Platini\">Michel Platini</a>&nbsp;et d&eacute;tient, depuis le 20 juin 2018, le record de buts pour un joueur europ&eacute;en en &eacute;quipe nationale, avec 99 r&eacute;alisations.</p>\r\n\r\n<p>&Eacute;lev&eacute; dans le quartier de Santo Antonio sur l&#39;&icirc;le de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Mad%C3%A8re\" title=\"Madère\">Mad&egrave;re</a>, il int&egrave;gre le centre de formation du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Sporting_Clube_de_Portugal\" title=\"Sporting Clube de Portugal\">Sporting Clube de Portugal</a>&nbsp;&agrave; l&#39;&acirc;ge de onze ans et signe son premier contrat professionnel en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/2002_en_football\" title=\"2002 en football\">2002</a>. Recrut&eacute; pour la somme de 15&nbsp;millions d&#39;euros par&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Manchester_United_Football_Club\" title=\"Manchester United Football Club\">Manchester United</a>&nbsp;durant l&#39;&eacute;t&eacute;&nbsp;<a href=\"https://fr.wikipedia.org/wiki/2003_en_football\" title=\"2003 en football\">2003</a>, il r&eacute;v&egrave;le son talent lors de l&#39;<a href=\"https://fr.wikipedia.org/wiki/Championnat_d%27Europe_de_football_2004\" title=\"Championnat d\'Europe de football 2004\">Euro 2004</a>&nbsp;&agrave; seulement 19&nbsp;ans avec le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/%C3%89quipe_du_Portugal_de_football\" title=\"Équipe du Portugal de football\">Portugal</a>. Il r&eacute;alise une excellente saison 2007-2008 avec&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Manchester_United_Football_Club\" title=\"Manchester United Football Club\">Manchester United</a>&nbsp;en remportant la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Championnat_d%27Angleterre_de_football\" title=\"Championnat d\'Angleterre de football\">Barclays Premier League</a>&nbsp;et la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ligue_des_champions_de_l%27UEFA\" title=\"Ligue des champions de l\'UEFA\">Ligue des champions</a>. En&nbsp;<a href=\"https://fr.wikipedia.org/wiki/2009_en_football\" title=\"2009 en football\">2009</a>, il est l&#39;objet du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Transfert_(football)#Montants_les_plus_%C3%A9lev%C3%A9s_dans_le_monde\" title=\"Transfert (football)\">transfert le plus &eacute;lev&eacute; de l&#39;histoire du football</a>, quand il quitte les&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Manchester_United_Football_Club\" title=\"Manchester United Football Club\">Red Devils</a>&nbsp;pour le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Real_Madrid_Club_de_F%C3%BAtbol\" title=\"Real Madrid Club de Fútbol\">Real Madrid</a>&nbsp;contre une indemnit&eacute; d&#39;environ 94&nbsp;millions d&#39;<a href=\"https://fr.wikipedia.org/wiki/Euro\" title=\"Euro\">euros</a>&nbsp;(d&eacute;tr&ocirc;n&eacute; en 2013 par son nouveau co&eacute;quipier&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Gareth_Bale\" title=\"Gareth Bale\">Gareth Bale</a>)<a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#cite_note-6\">6</a>. Il remporte avec le club madril&egrave;ne de nombreux troph&eacute;es comme le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Championnat_espagnol_de_football\" title=\"Championnat espagnol de football\">Championnat espagnol</a>&nbsp;en 2012 et 2017 et quatre fois la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ligue_des_champions_de_l%27UEFA\" title=\"Ligue des champions de l\'UEFA\">Ligue des champions</a>&nbsp;en 2014, 2016, 2017 et 2018. Le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/10_juillet_en_sport\" title=\"10 juillet en sport\">10</a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Juillet_2018_en_sport\" title=\"Juillet 2018 en sport\">juillet</a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/2018_en_sport\" title=\"2018 en sport\">2018</a>, il quitte le Real Madrid apr&egrave;s neuf saisons au club pour la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Juventus_Football_Club\" title=\"Juventus Football Club\">Juventus Turin</a>&nbsp;contre la somme de 105&nbsp;millions d&#39;euros. Il est &eacute;galement le capitaine et un des acteurs d&eacute;cisifs de l&#39;<a href=\"https://fr.wikipedia.org/wiki/%C3%89quipe_du_Portugal_de_football\" title=\"Équipe du Portugal de football\">&eacute;quipe du Portugal</a>&nbsp;qui remporte son tout premier titre international en battant la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/%C3%89quipe_de_France_de_football\" title=\"Équipe de France de football\">France</a>&nbsp;en finale de l&#39;<a href=\"https://fr.wikipedia.org/wiki/Championnat_d%27Europe_de_football\" title=\"Championnat d\'Europe de football\">Euro 2016</a>.</p>\r\n\r\n<p>Couronn&eacute;&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ballon_d%27or\" title=\"Ballon d\'or\">Ballon d&#39;or</a>&nbsp;en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ballon_d%27or_2008\" title=\"Ballon d\'or 2008\">2008</a>,&nbsp;<a href=\"https://fr.wikipedia.org/wiki/FIFA_Ballon_d%27or_2013\" title=\"FIFA Ballon d\'or 2013\">2013</a>,&nbsp;<a href=\"https://fr.wikipedia.org/wiki/FIFA_Ballon_d%27or_2014\" title=\"FIFA Ballon d\'or 2014\">2014</a>,&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ballon_d%27or_2016\" title=\"Ballon d\'or 2016\">2016</a>&nbsp;et&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ballon_d%27or_2017\" title=\"Ballon d\'or 2017\">2017</a>, deuxi&egrave;me en 2007, 2009, 2011, 2012, 2015 et 2018 et troisi&egrave;me en 2019, Ronaldo a &eacute;galement remport&eacute; des titres de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Meilleur_buteur_mondial_de_l%27ann%C3%A9e_(IFFHS)\" title=\"Meilleur buteur mondial de l\'année (IFFHS)\">meilleur buteur mondial de l&#39;ann&eacute;e (IFFHS)</a>&nbsp;(<a href=\"https://fr.wikipedia.org/wiki/2013_en_football\" title=\"2013 en football\">2013</a>,&nbsp;<a href=\"https://fr.wikipedia.org/wiki/2014_en_football\" title=\"2014 en football\">2014</a>&nbsp;et&nbsp;<a href=\"https://fr.wikipedia.org/wiki/2015_en_football\" title=\"2015 en football\">2015</a>), ainsi que de meilleur joueur (en 2012, 2013, 2014) et du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Meilleurs_buteurs_du_championnat_d%27Espagne_de_football\" title=\"Meilleurs buteurs du championnat d\'Espagne de football\">meilleur buteur du championnat d&rsquo;Espagne de football</a>&nbsp;(Pichichi) &agrave; trois reprises (2011, 2014, 2015). Il finit &eacute;galement&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Prix_UEFA_du_Meilleur_joueur_d%27Europe\" title=\"Prix UEFA du Meilleur joueur d\'Europe\">meilleur joueur d&#39;Europe</a>&nbsp;en 2014, 2016 et 2017 et&nbsp;<a href=\"https://fr.wikipedia.org/wiki/UEFA_Club_Football_Awards\" title=\"UEFA Club Football Awards\">meilleur footballeur de l&#39;ann&eacute;e UEFA</a>&nbsp;en 2008, ainsi qu&#39;en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/The_Best_FIFA_Football_Awards_2016\" title=\"The Best FIFA Football Awards 2016\">2016</a>&nbsp;et&nbsp;<a href=\"https://fr.wikipedia.org/wiki/The_Best_FIFA_Football_Awards_2017\" title=\"The Best FIFA Football Awards 2017\">2017</a>&nbsp;(<a href=\"https://fr.wikipedia.org/wiki/The_Best,_Joueur_de_la_FIFA\" title=\"The Best, Joueur de la FIFA\">The Best, Joueur de la FIFA</a>).</p>\r\n\r\n<p>Il est en 2016<a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#cite_note-7\">7</a>&nbsp;et en 2017<a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#cite_note-8\">8</a>, selon le magazine&nbsp;<em>Forbes</em>, le sportif le mieux r&eacute;mun&eacute;r&eacute; au monde, notamment gr&acirc;ce aux contrats publicitaires. Il a lanc&eacute;&nbsp;<em>CR7</em>, sa marque de sous-v&ecirc;tements, et, en collaboration avec la cha&icirc;ne d&#39;h&ocirc;tels Pestana, sa cha&icirc;ne d&#39;h&ocirc;tels. L&#39;a&eacute;roport de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Funchal\" title=\"Funchal\">Funchal</a>, ville natale du joueur, porte son nom depuis le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/24_mars\" title=\"24 mars\">24</a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Mars_2017\" title=\"Mars 2017\">mars</a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/2017\" title=\"2017\">2017</a>&nbsp;: l&#39;<a href=\"https://fr.wikipedia.org/wiki/A%C3%A9roport_de_Mad%C3%A8re\" title=\"Aéroport de Madère\">a&eacute;roport Cristiano-Ronaldo</a><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#cite_note-Cristiano_Ronaldo,_un_h%C3%B4tel_et_un_a%C3%A9roport_%C3%A0_son_nom-9\">9</a>,<a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#cite_note-10\">10</a>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Sommaire</h2>\r\n\r\n<ul>\r\n	<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Carri%C3%A8re_de_joueur\">1Carri&egrave;re de joueur</a>\r\n\r\n	<ul>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Carri%C3%A8re_en_club\">1.1Carri&egrave;re en club</a>\r\n\r\n		<ul>\r\n			<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Parcours_junior\">1.1.1Parcours junior</a></li>\r\n			<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Sporting_Club_de_Portugal_(1997-2003)\">1.1.2Sporting Club de Portugal (1997-2003)</a></li>\r\n			<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Manchester_United_(2003-2009)\">1.1.3Manchester United (2003-2009)</a>\r\n			<ul>\r\n				<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#2003-2006_:_Jeune_espoir_en_Angleterre\">1.1.3.12003-2006&nbsp;: Jeune espoir en Angleterre</a></li>\r\n				<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#2006-2007_:_L\'explosion\">1.1.3.22006-2007&nbsp;: L&#39;explosion</a></li>\r\n				<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#2007-2008_:_Vers_le_ballon_d\'or\">1.1.3.32007-2008&nbsp;: Vers le ballon d&#39;or</a></li>\r\n				<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#2008-2009_:_Une_saison_difficile\">1.1.3.42008-2009&nbsp;: Une saison difficile</a></li>\r\n			</ul>\r\n			</li>\r\n			<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Real_Madrid_(2009-2018)\">1.1.4Real Madrid (2009-2018)</a>\r\n			<ul>\r\n				<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#2009-2010_:_Les_d%C3%A9buts_en_Liga\">1.1.4.12009-2010&nbsp;: Les d&eacute;buts en Liga</a></li>\r\n				<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#2010-2011_:_Saison_de_records\">1.1.4.22010-2011&nbsp;: Saison de records</a></li>\r\n				<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#2011-2012_:_La_cons%C3%A9cration_nationale\">1.1.4.32011-2012&nbsp;: La cons&eacute;cration nationale</a></li>\r\n				<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#2012-2013_:_Une_m%C3%A9forme_collective\">1.1.4.42012-2013&nbsp;: Une m&eacute;forme collective</a></li>\r\n				<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#2013-2014_:_La_Decima\">1.1.4.52013-2014&nbsp;: La Decima</a></li>\r\n				<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#2014-2015_:_Saison_exceptionnelle_au_niveau_individuel\">1.1.4.62014-2015&nbsp;: Saison exceptionnelle au niveau individuel</a></li>\r\n				<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#2015-2016_:_Double_champion_d\'Europe\">1.1.4.72015-2016&nbsp;: Double champion d&#39;Europe</a></li>\r\n				<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#2016-2017_:_Doubl%C3%A9_Liga_-_Ligue_des_champions\">1.1.4.82016-2017&nbsp;: Doubl&eacute; Liga - Ligue des champions</a></li>\r\n				<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#2017-2018_:_5e_Ligue_des_champions\">1.1.4.92017-2018&nbsp;: 5e&nbsp;Ligue des champions</a></li>\r\n			</ul>\r\n			</li>\r\n			<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Juventus_(depuis_2018)\">1.1.5Juventus (depuis 2018)</a>\r\n			<ul>\r\n				<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#2018-2019_:_Premier_titre_en_Italie\">1.1.5.12018-2019&nbsp;: Premier titre en Italie</a></li>\r\n				<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#2019-2020\">1.1.5.22019-2020</a></li>\r\n			</ul>\r\n			</li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Carri%C3%A8re_internationale\">2Carri&egrave;re internationale</a>\r\n	<ul>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#La_r%C3%A9v%C3%A9lation_lors_de_l\'Euro_2004\">2.1La r&eacute;v&eacute;lation lors de l&#39;Euro 2004</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Coupe_du_monde_2006\">2.2Coupe du monde 2006</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Euro_2008\">2.3Euro 2008</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Coupe_du_monde_2010\">2.4Coupe du monde 2010</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Euro_2012_:_Capitaine_cl%C3%A9\">2.5Euro 2012&nbsp;: Capitaine cl&eacute;</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#%C3%89chec_%C3%A0_la_Coupe_du_monde_2014\">2.6&Eacute;chec &agrave; la Coupe du monde 2014</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Cons%C3%A9cration_%C3%A0_l\'Euro_2016\">2.7Cons&eacute;cration &agrave; l&#39;Euro 2016</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Coupe_des_conf%C3%A9d%C3%A9rations_2017\">2.8Coupe des conf&eacute;d&eacute;rations 2017</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Coupe_du_monde_2018\">2.9Coupe du monde 2018</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Ligue_des_nations_2018-2019\">2.10Ligue des nations 2018-2019</a></li>\r\n	</ul>\r\n	</li>\r\n	<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Style_de_jeu\">3Style de jeu</a></li>\r\n	<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Aspects_socio-%C3%A9conomiques\">4Aspects socio-&eacute;conomiques</a>\r\n	<ul>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Impact_m%C3%A9diatique\">4.1Impact m&eacute;diatique</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Vie_priv%C3%A9e\">4.2Vie priv&eacute;e</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Humanitaire\">4.3Humanitaire</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Contrats_publicitaires\">4.4Contrats publicitaires</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Revenus\">4.5Revenus</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#%C3%89vasion_fiscale\">4.6&Eacute;vasion fiscale</a></li>\r\n	</ul>\r\n	</li>\r\n	<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Statistiques_d%C3%A9taill%C3%A9es\">5Statistiques d&eacute;taill&eacute;es</a>\r\n	<ul>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#En_club\">5.1En club</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#En_s%C3%A9lection_nationale\">5.2En s&eacute;lection nationale</a></li>\r\n	</ul>\r\n	</li>\r\n	<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Palmar%C3%A8s\">6Palmar&egrave;s</a>\r\n	<ul>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#En_club_2\">6.1En club</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#En_s%C3%A9lection_nationale_2\">6.2En s&eacute;lection nationale</a></li>\r\n	</ul>\r\n	</li>\r\n	<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Distinctions_personnelles_et_records\">7Distinctions personnelles et records</a></li>\r\n	<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Notes_et_r%C3%A9f%C3%A9rences\">8Notes et r&eacute;f&eacute;rences</a></li>\r\n	<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Voir_aussi\">9Voir aussi</a>\r\n	<ul>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Bibliographie\">9.1Bibliographie</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Documentaires\">9.2Documentaires</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Annexes\">9.3Annexes</a></li>\r\n		<li><a href=\"https://fr.wikipedia.org/wiki/Cristiano_Ronaldo#Liens_externes\">9.4Liens externes</a></li>\r\n	</ul>\r\n	</li>\r\n</ul>', 1, 'discussion', '2020-03-30 16:47:57', 0),
(16, 14, 'TUN', '<h2>G&eacute;ographie[<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;veaction=edit&amp;section=2\" title=\"Modifier la section : Géographie\">modifier</a>&nbsp;|&nbsp;<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;action=edit&amp;section=2\" title=\"Modifier la section : Géographie\">modifier le code</a>]</h2>\r\n\r\n<p>Article d&eacute;taill&eacute;&nbsp;:&nbsp;<a href=\"https://fr.wikipedia.org/wiki/G%C3%A9ographie_de_la_Tunisie\" title=\"Géographie de la Tunisie\">G&eacute;ographie de la Tunisie</a>.</p>\r\n\r\n<p>La Tunisie, le plus petit des &Eacute;tats du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Maghreb\" title=\"Maghreb\">Maghreb</a>, se situe au&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Afrique_du_Nord\" title=\"Afrique du Nord\">nord</a>&nbsp;du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Afrique\" title=\"Afrique\">continent africain</a>. Il est s&eacute;par&eacute; de l&#39;<a href=\"https://fr.wikipedia.org/wiki/Europe\" title=\"Europe\">Europe</a>&nbsp;par une distance de 140&nbsp;kilom&egrave;tres au niveau du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Canal_de_Sicile\" title=\"Canal de Sicile\">canal de Sicile</a>.</p>\r\n\r\n<p><a href=\"https://commons.wikimedia.org/wiki/File:Tunisia_Topography.png?uselang=fr\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/3/3c/Tunisia_Topography.png/220px-Tunisia_Topography.png\" style=\"height:358px; width:220px\" /></a></p>\r\n\r\n<p>Topographie de la Tunisie.</p>\r\n\r\n<p>Disposant d&#39;une&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Aire_(g%C3%A9om%C3%A9trie)\" title=\"Aire (géométrie)\">superficie</a>&nbsp;de 163&nbsp;610&nbsp;km2<a href=\"https://fr.wikipedia.org/wiki/Tunisie#cite_note-17\">17</a>, le pays est limit&eacute; &agrave; l&#39;ouest par l&#39;<a href=\"https://fr.wikipedia.org/wiki/Alg%C3%A9rie\" title=\"Algérie\">Alg&eacute;rie</a>&nbsp;avec 965&nbsp;km&nbsp;de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Fronti%C3%A8re_entre_l%27Alg%C3%A9rie_et_la_Tunisie\" title=\"Frontière entre l\'Algérie et la Tunisie\">fronti&egrave;re commune</a>, au sud-sud-est par la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Libye\" title=\"Libye\">Libye</a>&nbsp;avec 459&nbsp;km&nbsp;de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Fronti%C3%A8re_entre_la_Libye_et_la_Tunisie\" title=\"Frontière entre la Libye et la Tunisie\">fronti&egrave;re</a>&nbsp;et au nord et &agrave; l&#39;est par la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Mer_M%C3%A9diterran%C3%A9e\" title=\"Mer Méditerranée\">mer M&eacute;diterran&eacute;e</a>&nbsp;avec 1&nbsp;298&nbsp;km&nbsp;de c&ocirc;tes.</p>\r\n\r\n<p>Le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/D%C3%A9sert\" title=\"Désert\">d&eacute;sert</a>&nbsp;du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Sahara\" title=\"Sahara\">Sahara</a>&nbsp;occupe une superficie comprise entre 33&nbsp;% et 40&nbsp;% du territoire selon qu&#39;on le d&eacute;finisse d&#39;apr&egrave;s son&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Aridit%C3%A9\" title=\"Aridité\">aridit&eacute;</a>&nbsp;ou selon des caract&eacute;ristiques paysag&egrave;res. La superficie des terres &agrave; vocation agricole est estim&eacute;e &agrave; dix millions d&#39;<a href=\"https://fr.wikipedia.org/wiki/Hectare\" title=\"Hectare\">hectares</a>, r&eacute;parties en cinq millions de terres labourables, quatre millions de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Parcours_(pastoralisme)\" title=\"Parcours (pastoralisme)\">parcours naturels</a>&nbsp;et un million de for&ecirc;ts et garrigues<a href=\"https://fr.wikipedia.org/wiki/Tunisie#cite_note-18\">18</a>.</p>\r\n\r\n<h3>Topographie[<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;veaction=edit&amp;section=3\" title=\"Modifier la section : Topographie\">modifier</a>&nbsp;|&nbsp;<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;action=edit&amp;section=3\" title=\"Modifier la section : Topographie\">modifier le code</a>]</h3>\r\n\r\n<p><a href=\"https://commons.wikimedia.org/wiki/File:Jebel_Rassas,_Ben_Arous,_Tunisia.jpg?uselang=fr\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/3/32/Jebel_Rassas%2C_Ben_Arous%2C_Tunisia.jpg/220px-Jebel_Rassas%2C_Ben_Arous%2C_Tunisia.jpg\" style=\"height:147px; width:220px\" /></a></p>\r\n\r\n<p>Silhouette du Djebel Ressas dominant la plaine de Mornag.</p>\r\n\r\n<p>La Tunisie poss&egrave;de un&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Relief_(g%C3%A9omorphologie)\" title=\"Relief (géomorphologie)\">relief</a>&nbsp;contrast&eacute; avec une partie septentrionale et occidentale montagneuse, la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Dorsale_tunisienne\" title=\"Dorsale tunisienne\">dorsale tunisienne</a>, situ&eacute;e dans l&#39;extension du massif montagneux de l&#39;<a href=\"https://fr.wikipedia.org/wiki/Atlas_(massif)\" title=\"Atlas (massif)\">Atlas</a>&nbsp;; elle est coup&eacute;e par la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Plaine\" title=\"Plaine\">plaine</a>&nbsp;de la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Medjerda\" title=\"Medjerda\">Medjerda</a>, le seul&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Cours_d%27eau\" title=\"Cours d\'eau\">cours d&#39;eau</a>&nbsp;du pays qui soit aliment&eacute; de fa&ccedil;on continue.</p>\r\n\r\n<p>Le point culminant du territoire est le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Djebel_Chambi\" title=\"Djebel Chambi\">Djebel Chambi</a>&nbsp;culminant &agrave; 1&nbsp;544 m&egrave;tres<a href=\"https://fr.wikipedia.org/wiki/Tunisie#cite_note-19\">19</a>. &Agrave; l&#39;est, une plaine s&#39;&eacute;tend entre&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Hammamet\" title=\"Hammamet\">Hammamet</a>&nbsp;et&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ben_Gardane\" title=\"Ben Gardane\">Ben Gardane</a>, via le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Sahel_tunisien\" title=\"Sahel tunisien\">Sahel tunisien</a>&nbsp;et la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Djeffara\" title=\"Djeffara\">Djeffara</a>.</p>\r\n\r\n<p>La partie m&eacute;ridionale du pays, principalement d&eacute;sertique, est divis&eacute;e entre une succession de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Chott\" title=\"Chott\">chotts</a>&nbsp;(<a href=\"https://fr.wikipedia.org/wiki/Chott_el-Gharsa\" title=\"Chott el-Gharsa\">Chott el-Gharsa</a>,&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Chott_el-J%C3%A9rid\" title=\"Chott el-Jérid\">Chott el-J&eacute;rid</a>&nbsp;et&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Chott_el-Fejaj\" title=\"Chott el-Fejaj\">Chott el-Fejaj</a>), des plateaux rocheux et les&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Dune\" title=\"Dune\">dunes</a>&nbsp;du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Grand_Erg_oriental\" title=\"Grand Erg oriental\">Grand Erg oriental</a>. Le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Littoral\" title=\"Littoral\">littoral</a>&nbsp;parsem&eacute; de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Tombolo\" title=\"Tombolo\">tombolos</a>&nbsp;et de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Lagune\" title=\"Lagune\">lagunes</a>&nbsp;s&#39;&eacute;tend sur 1&nbsp;298 kilom&egrave;tres dont 575 de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Plage\" title=\"Plage\">plages</a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Sable\" title=\"Sable\">sablonneuses</a>. Quelques&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Liste_des_%C3%AEles_de_Tunisie\" title=\"Liste des îles de Tunisie\">&icirc;les</a>&nbsp;dont les&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Kerkennah\" title=\"Kerkennah\">Kerkennah</a>&nbsp;et&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Djerba\" title=\"Djerba\">Djerba</a>&nbsp;pars&egrave;ment le littoral.</p>\r\n\r\n<h3>Climat[<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;veaction=edit&amp;section=4\" title=\"Modifier la section : Climat\">modifier</a>&nbsp;|&nbsp;<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;action=edit&amp;section=4\" title=\"Modifier la section : Climat\">modifier le code</a>]</h3>\r\n\r\n<p><a href=\"https://commons.wikimedia.org/wiki/File:Pont_Cinqui%C3%A8me_de_B%C3%A9ja_-_Mai_2014_(3).JPG?uselang=fr\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/d/dd/Pont_Cinqui%C3%A8me_de_B%C3%A9ja_-_Mai_2014_%283%29.JPG/220px-Pont_Cinqui%C3%A8me_de_B%C3%A9ja_-_Mai_2014_%283%29.JPG\" style=\"height:146px; width:220px\" /></a></p>\r\n\r\n<p>Paysage du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Nord-Ouest_tunisien\" title=\"Nord-Ouest tunisien\">Nord-Ouest tunisien</a>.</p>\r\n\r\n<p><a href=\"https://commons.wikimedia.org/wiki/File:SaharaTunisien.JPG?uselang=fr\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/a/a3/SaharaTunisien.JPG/220px-SaharaTunisien.JPG\" style=\"height:165px; width:220px\" /></a></p>\r\n\r\n<p>Paysage du Sud tunisien.</p>\r\n\r\n<p>Le climat de la Tunisie se divise en sept zones bioclimatiques, la grande diff&eacute;rence entre le nord et le reste du pays &eacute;tant due &agrave; la cha&icirc;ne de la dorsale tunisienne qui s&eacute;pare les zones soumises au&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Climat_m%C3%A9diterran%C3%A9en\" title=\"Climat méditerranéen\">climat m&eacute;diterran&eacute;en</a>&nbsp;(<a href=\"https://fr.wikipedia.org/wiki/Classification_de_K%C3%B6ppen\" title=\"Classification de Köppen\">classification de K&ouml;ppen</a>&nbsp;<em>Csa</em>) de celles soumises au&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Climat_d%C3%A9sertique#Climat_d%C3%A9sertique_chaud\" title=\"Climat désertique\">climat d&eacute;sertique chaud</a>&nbsp;(classification de K&ouml;ppen&nbsp;<em>BWh</em>) typique du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Sahara\" title=\"Sahara\">Sahara</a>, le plus grand d&eacute;sert chaud du globe. Entre les deux, on y trouve le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Climat_semi-aride\" title=\"Climat semi-aride\">climat semi-aride</a>&nbsp;chaud (classification de K&ouml;ppen&nbsp;<em>BSh</em>) avec des caract&eacute;ristiques communes aux deux principaux r&eacute;gimes climatiques du pays.</p>\r\n\r\n<p>En raison de sa situation g&eacute;ographique, le climat tunisien est influenc&eacute; par divers types de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Vent\" title=\"Vent\">vents</a>&nbsp;: la c&ocirc;te nord est expos&eacute;e aux vents marins doux et humides soufflant depuis le sud de la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/France\" title=\"France\">France</a>, ce qui provoque une baisse</p>', 2, 'question', '2020-04-01 20:37:23', 1);
INSERT INTO `post` (`id`, `user_id`, `title`, `text`, `votecount`, `category`, `dateadded`, `solved`) VALUES
(17, 14, 'TEST', '<h2>Toponymie[<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;veaction=edit&amp;section=1\" title=\"Modifier la section : Toponymie\">modifier</a>&nbsp;|&nbsp;<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;action=edit&amp;section=1\" title=\"Modifier la section : Toponymie\">modifier le code</a>]</h2>\r\n\r\n<p>Le nom actuel de la&nbsp;&laquo;&nbsp;Tunisie&nbsp;&raquo;, qui vient du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Fran%C3%A7ais\" title=\"Français\">fran&ccedil;ais</a>, est d&eacute;riv&eacute; du nom de la capitale,&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Tunis\" title=\"Tunis\">Tunis</a>, suivi du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Affixe\" title=\"Affixe\">suffixe</a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Latin\" title=\"Latin\">latin</a>&nbsp;-ie<a href=\"https://fr.wikipedia.org/wiki/Tunisie#cite_note-adrian-16\">16</a>. Le d&eacute;riv&eacute; latin est par la suite adopt&eacute; dans plusieurs autres langues europ&eacute;ennes, &agrave; quelques modifications pr&egrave;s, pour diff&eacute;rencier le pays de la ville de Tunis.</p>\r\n\r\n<p>Toutefois, dans certaines langues, il n&#39;y a pas eu une telle modification, comme en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Russe\" title=\"Russe\">russe</a>&nbsp;(<em>Туни́с</em>), en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Espagnol\" title=\"Espagnol\">espagnol</a>&nbsp;(<em>T&uacute;nez</em>) et en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Arabe\" title=\"Arabe\">arabe</a>&nbsp;(تونس&nbsp;ou&nbsp;<em>Tunis</em>). Dans ces cas, seul le contexte permet de d&eacute;terminer si l&#39;on parle de la ville ou du pays.</p>\r\n\r\n<p>Avant cela, le territoire de la Tunisie est appel&eacute;&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ifriqiya\" title=\"Ifriqiya\">Ifriqiya</a>&nbsp;ou encore&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Province_d%27Afrique\" title=\"Province d\'Afrique\">Africa</a>&nbsp;dans l&#39;<a href=\"https://fr.wikipedia.org/wiki/Antiquit%C3%A9\" title=\"Antiquité\">Antiquit&eacute;</a>, ce qui donne par la suite son nom &agrave; l&#39;<a href=\"https://fr.wikipedia.org/wiki/Afrique\" title=\"Afrique\">Afrique</a>.</p>\r\n\r\n<h2>G&eacute;ographie[<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;veaction=edit&amp;section=2\" title=\"Modifier la section : Géographie\">modifier</a>&nbsp;|&nbsp;<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;action=edit&amp;section=2\" title=\"Modifier la section : Géographie\">modifier le code</a>]</h2>\r\n\r\n<p>Article d&eacute;taill&eacute;&nbsp;:&nbsp;<a href=\"https://fr.wikipedia.org/wiki/G%C3%A9ographie_de_la_Tunisie\" title=\"Géographie de la Tunisie\">G&eacute;ographie de la Tunisie</a>.</p>\r\n\r\n<p>La Tunisie, le plus petit des &Eacute;tats du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Maghreb\" title=\"Maghreb\">Maghreb</a>, se situe au&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Afrique_du_Nord\" title=\"Afrique du Nord\">nord</a>&nbsp;du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Afrique\" title=\"Afrique\">continent africain</a>. Il est s&eacute;par&eacute; de l&#39;<a href=\"https://fr.wikipedia.org/wiki/Europe\" title=\"Europe\">Europe</a>&nbsp;par une distance de 140&nbsp;kilom&egrave;tres au niveau du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Canal_de_Sicile\" title=\"Canal de Sicile\">canal de Sicile</a>.</p>\r\n\r\n<p><a href=\"https://commons.wikimedia.org/wiki/File:Tunisia_Topography.png?uselang=fr\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/3/3c/Tunisia_Topography.png/220px-Tunisia_Topography.png\" style=\"height:358px; width:220px\" /></a></p>\r\n\r\n<p>Topographie de la Tunisie.</p>\r\n\r\n<p>Disposant d&#39;une&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Aire_(g%C3%A9om%C3%A9trie)\" title=\"Aire (géométrie)\">superficie</a>&nbsp;de 163&nbsp;610&nbsp;km2<a href=\"https://fr.wikipedia.org/wiki/Tunisie#cite_note-17\">17</a>, le pays est limit&eacute; &agrave; l&#39;ouest par l&#39;<a href=\"https://fr.wikipedia.org/wiki/Alg%C3%A9rie\" title=\"Algérie\">Alg&eacute;rie</a>&nbsp;avec 965&nbsp;km&nbsp;de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Fronti%C3%A8re_entre_l%27Alg%C3%A9rie_et_la_Tunisie\" title=\"Frontière entre l\'Algérie et la Tunisie\">fronti&egrave;re commune</a>, au sud-sud-est par la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Libye\" title=\"Libye\">Libye</a>&nbsp;avec 459&nbsp;km&nbsp;de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Fronti%C3%A8re_entre_la_Libye_et_la_Tunisie\" title=\"Frontière entre la Libye et la Tunisie\">fronti&egrave;re</a>&nbsp;et au nord et &agrave; l&#39;est par la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Mer_M%C3%A9diterran%C3%A9e\" title=\"Mer Méditerranée\">mer M&eacute;diterran&eacute;e</a>&nbsp;avec 1&nbsp;298&nbsp;km&nbsp;de c&ocirc;tes.</p>\r\n\r\n<p>Le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/D%C3%A9sert\" title=\"Désert\">d&eacute;sert</a>&nbsp;du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Sahara\" title=\"Sahara\">Sahara</a>&nbsp;occupe une superficie comprise entre 33&nbsp;% et 40&nbsp;% du territoire selon qu&#39;on le d&eacute;finisse d&#39;apr&egrave;s son&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Aridit%C3%A9\" title=\"Aridité\">aridit&eacute;</a>&nbsp;ou selon des caract&eacute;ristiques paysag&egrave;res. La superficie des terres &agrave; vocation agricole est estim&eacute;e &agrave; dix millions d&#39;<a href=\"https://fr.wikipedia.org/wiki/Hectare\" title=\"Hectare\">hectares</a>, r&eacute;parties en cinq millions de terres labourables, quatre millions de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Parcours_(pastoralisme)\" title=\"Parcours (pastoralisme)\">parcours naturels</a>&nbsp;et un million de for&ecirc;ts et garrigues<a href=\"https://fr.wikipedia.org/wiki/Tunisie#cite_note-18\">18</a>.</p>\r\n\r\n<h3>Topographie[<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;veaction=edit&amp;section=3\" title=\"Modifier la section : Topographie\">modifier</a>&nbsp;|&nbsp;<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;action=edit&amp;section=3\" title=\"Modifier la section : Topographie\">modifier le code</a>]</h3>\r\n\r\n<p><a href=\"https://commons.wikimedia.org/wiki/File:Jebel_Rassas,_Ben_Arous,_Tunisia.jpg?uselang=fr\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/3/32/Jebel_Rassas%2C_Ben_Arous%2C_Tunisia.jpg/220px-Jebel_Rassas%2C_Ben_Arous%2C_Tunisia.jpg\" style=\"height:147px; width:220px\" /></a></p>\r\n\r\n<p>Silhouette du Djebel Ressas dominant la plaine de Mornag.</p>\r\n\r\n<p>La Tunisie poss&egrave;de un&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Relief_(g%C3%A9omorphologie)\" title=\"Relief (géomorphologie)\">relief</a>&nbsp;contrast&eacute; avec une partie septentrionale et occidentale montagneuse, la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Dorsale_tunisienne\" title=\"Dorsale tunisienne\">dorsale tunisienne</a>, situ&eacute;e dans l&#39;extension du massif montagneux de l&#39;<a href=\"https://fr.wikipedia.org/wiki/Atlas_(massif)\" title=\"Atlas (massif)\">Atlas</a>&nbsp;; elle est coup&eacute;e par la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Plaine\" title=\"Plaine\">plaine</a>&nbsp;de la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Medjerda\" title=\"Medjerda\">Medjerda</a>, le seul&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Cours_d%27eau\" title=\"Cours d\'eau\">cours d&#39;eau</a>&nbsp;du pays qui soit aliment&eacute; de fa&ccedil;on continue.</p>\r\n\r\n<p>Le point culminant du territoire est le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Djebel_Chambi\" title=\"Djebel Chambi\">Djebel Chambi</a>&nbsp;culminant &agrave; 1&nbsp;544 m&egrave;tres<a href=\"https://fr.wikipedia.org/wiki/Tunisie#cite_note-19\">19</a>. &Agrave; l&#39;est, une plaine s&#39;&eacute;tend entre&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Hammamet\" title=\"Hammamet\">Hammamet</a>&nbsp;et&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ben_Gardane\" title=\"Ben Gardane\">Ben Gardane</a>, via le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Sahel_tunisien\" title=\"Sahel tunisien\">Sahel tunisien</a>&nbsp;et la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Djeffara\" title=\"Djeffara\">Djeffara</a>.</p>\r\n\r\n<p>La partie m&eacute;ridionale du pays, principalement d&eacute;sertique, est divis&eacute;e entre une succession de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Chott\" title=\"Chott\">chotts</a>&nbsp;(<a href=\"https://fr.wikipedia.org/wiki/Chott_el-Gharsa\" title=\"Chott el-Gharsa\">Chott el-Gharsa</a>,&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Chott_el-J%C3%A9rid\" title=\"Chott el-Jérid\">Chott el-J&eacute;rid</a>&nbsp;et&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Chott_el-Fejaj\" title=\"Chott el-Fejaj\">Chott el-Fejaj</a>), des plateaux rocheux et les&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Dune\" title=\"Dune\">dunes</a>&nbsp;du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Grand_Erg_oriental\" title=\"Grand Erg oriental\">Grand Erg oriental</a>. Le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Littoral\" title=\"Littoral\">littoral</a>&nbsp;parsem&eacute; de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Tombolo\" title=\"Tombolo\">tombolos</a>&nbsp;et de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Lagune\" title=\"Lagune\">lagunes</a>&nbsp;s&#39;&eacute;tend sur 1&nbsp;298 kilom&egrave;tres dont 575 de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Plage\" title=\"Plage\">plages</a>&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Sable\" title=\"Sable\">sablonneuses</a>. Quelques&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Liste_des_%C3%AEles_de_Tunisie\" title=\"Liste des îles de Tunisie\">&icirc;les</a>&nbsp;dont les&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Kerkennah\" title=\"Kerkennah\">Kerkennah</a>&nbsp;et&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Djerba\" title=\"Djerba\">Djerba</a>&nbsp;pars&egrave;ment le littoral.</p>\r\n\r\n<h3>Climat[<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;veaction=edit&amp;section=4\" title=\"Modifier la section : Climat\">modifier</a>&nbsp;|&nbsp;<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;action=edit&amp;section=4\" title=\"Modifier la section : Climat\">modifier le code</a>]</h3>\r\n\r\n<p><a href=\"https://commons.wikimedia.org/wiki/File:Pont_Cinqui%C3%A8me_de_B%C3%A9ja_-_Mai_2014_(3).JPG?uselang=fr\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/d/dd/Pont_Cinqui%C3%A8me_de_B%C3%A9ja_-_Mai_2014_%283%29.JPG/220px-Pont_Cinqui%C3%A8me_de_B%C3%A9ja_-_Mai_2014_%283%29.JPG\" style=\"height:146px; width:220px\" /></a></p>\r\n\r\n<p>Paysage du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Nord-Ouest_tunisien\" title=\"Nord-Ouest tunisien\">Nord-Ouest tunisien</a>.</p>\r\n\r\n<p><a href=\"https://commons.wikimedia.org/wiki/File:SaharaTunisien.JPG?uselang=fr\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/a/a3/SaharaTunisien.JPG/220px-SaharaTunisien.JPG\" style=\"height:165px; width:220px\" /></a></p>\r\n\r\n<p>Paysage du Sud tunisien.</p>\r\n\r\n<p>Le climat de la Tunisie se divise en sept zones bioclimatiques, la grande diff&eacute;rence entre le nord et le reste du pays &eacute;tant due &agrave; la cha&icirc;ne de la dorsale tunisienne qui s&eacute;pare les zones soumises au&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Climat_m%C3%A9diterran%C3%A9en\" title=\"Climat méditerranéen\">climat m&eacute;diterran&eacute;en</a>&nbsp;(<a href=\"https://fr.wikipedia.org/wiki/Classification_de_K%C3%B6ppen\" title=\"Classification de Köppen\">classification de K&ouml;ppen</a>&nbsp;<em>Csa</em>) de celles soumises au&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Climat_d%C3%A9sertique#Climat_d%C3%A9sertique_chaud\" title=\"Climat désertique\">climat d&eacute;sertique chaud</a>&nbsp;(classification de K&ouml;ppen&nbsp;<em>BWh</em>) typique du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Sahara\" title=\"Sahara\">Sahara</a>, le plus grand d&eacute;sert chaud du globe. Entre les deux, on y trouve le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Climat_semi-aride\" title=\"Climat semi-aride\">climat semi-aride</a>&nbsp;chaud (classification de K&ouml;ppen&nbsp;<em>BSh</em>) avec des caract&eacute;ristiques communes aux deux principaux r&eacute;gimes climatiques du pays.</p>\r\n\r\n<p>En raison de sa situation g&eacute;ographique, le climat tunisien est influenc&eacute; par divers types de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Vent\" title=\"Vent\">vents</a>&nbsp;: la c&ocirc;te nord est expos&eacute;e aux vents marins doux et humides soufflant depuis le sud de la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/France\" title=\"France\">France</a>, ce qui provoque une baisse significative des temp&eacute;ratures et une hausse des&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Pr%C3%A9cipitations\" title=\"Précipitations\">pr&eacute;cipitations</a>, et le sud du pays aux vents continentaux chauds et secs, tels le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Sirocco\" title=\"Sirocco\">sirocco</a>&nbsp;soufflant sur les grandes &eacute;tendues d&eacute;sertiques et les plaines, provoquant alors une brutale hausse des temp&eacute;ratures et un net ass&egrave;chement de l&#39;atmosph&egrave;re.</p>\r\n\r\n<p>Le pays b&eacute;n&eacute;ficie &eacute;galement d&#39;un taux d&#39;ensoleillement important d&eacute;passant 3&nbsp;000&nbsp;heures par an et qui atteint des sommets dans le sud d&eacute;sertique, aux abords des fronti&egrave;res alg&eacute;rienne et libyenne<a href=\"https://fr.wikipedia.org/wiki/Tunisie#cite_note-20\">20</a>,<a href=\"https://fr.wikipedia.org/wiki/Tunisie#cite_note-21\">21</a>.</p>\r\n\r\n<p>Les&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Temp%C3%A9rature\" title=\"Température\">temp&eacute;ratures</a>&nbsp;varient en fonction de la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Latitude\" title=\"Latitude\">latitude</a>, de l&#39;<a href=\"https://fr.wikipedia.org/wiki/Altitude\" title=\"Altitude\">altitude</a>&nbsp;et de la proximit&eacute; ou de l&#39;&eacute;loignement de la&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Mer_M%C3%A9diterran%C3%A9e\" title=\"Mer Méditerranée\">mer M&eacute;diterran&eacute;e</a>. S&#39;il peut faire quelques degr&eacute;s au-dessous de&nbsp;0&nbsp;&deg;C&nbsp;dans les montagnes de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Kroumirie\" title=\"Kroumirie\">Kroumirie</a>&nbsp;en hiver, la temp&eacute;rature maximale grimpe souvent aux environs de&nbsp;50&nbsp;&deg;C&nbsp;dans les r&eacute;gions d&eacute;sertiques en &eacute;t&eacute;. La pluviom&eacute;trie annuelle moyenne varie &eacute;galement selon les r&eacute;gions&nbsp;: d&#39;environ 1&nbsp;000&nbsp;millim&egrave;tres au nord &agrave; environ 380&nbsp;mm&nbsp;au centre et jusqu&#39;&agrave; moins de 50&nbsp;mm&nbsp;&agrave; l&#39;extr&ecirc;me sud.</p>\r\n\r\n<h3>Environnement[<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;veaction=edit&amp;section=5\" title=\"Modifier la section : Environnement\">modifier</a>&nbsp;|&nbsp;<a href=\"https://fr.wikipedia.org/w/index.php?title=Tunisie&amp;action=edit&amp;section=5\" title=\"Modifier la section : Environnement\">modifier le code</a>]</h3>\r\n\r\n<p>Articles connexes&nbsp;:&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Flore_de_Tunisie\" title=\"Flore de Tunisie\">Flore de Tunisie</a>,&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Faune_de_Tunisie\" title=\"Faune de Tunisie\">Faune de Tunisie</a>,&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Liste_des_%C3%A9cor%C3%A9gions_de_Tunisie\" title=\"Liste des écorégions de Tunisie\">Liste des &eacute;cor&eacute;gions de Tunisie</a>&nbsp;et&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Liste_des_sites_Ramsar_en_Tunisie\" title=\"Liste des sites Ramsar en Tunisie\">Liste des sites Ramsar en Tunisie</a>.</p>\r\n\r\n<p><a href=\"https://commons.wikimedia.org/wiki/File:Cameleon_Tunisie.jpg?uselang=fr\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/e/e6/Cameleon_Tunisie.jpg/220px-Cameleon_Tunisie.jpg\" style=\"height:170px; width:220px\" /></a></p>\r\n\r\n<p><a href=\"https://fr.wikipedia.org/wiki/Cam%C3%A9l%C3%A9on_commun\" title=\"Caméléon commun\">Cam&eacute;l&eacute;on commun</a>.</p>\r\n\r\n<p><a href=\"https://commons.wikimedia.org/wiki/File:Hindi1.JPG?uselang=fr\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Hindi1.JPG/220px-Hindi1.JPG\" style=\"height:165px; width:220px\" /></a></p>\r\n\r\n<p><a href=\"https://fr.wikipedia.org/wiki/Figuier_de_Barbarie\" title=\"Figuier de Barbarie\">Figuier de Barbarie</a>.</p>\r\n\r\n<p>La&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Flore\" title=\"Flore\">flore</a>&nbsp;varie beaucoup en fonction des r&eacute;gions&nbsp;: celle des r&eacute;gions c&ocirc;ti&egrave;res est semblable &agrave; celle de l&#39;Europe m&eacute;ridionale et comprend&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Prairie_(agriculture)\" title=\"Prairie (agriculture)\">prairies</a>,&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Garrigue\" title=\"Garrigue\">garrigue</a>,&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Maquis_(botanique)\" title=\"Maquis (botanique)\">maquis</a>&nbsp;et for&ecirc;ts de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Ch%C3%AAne-li%C3%A8ge\" title=\"Chêne-liège\">ch&ecirc;nes-li&egrave;ge</a>. Plus au sud, la v&eacute;g&eacute;tation est de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Steppe\" title=\"Steppe\">type steppique</a>&nbsp;avec une dominance de l&#39;<a href=\"https://fr.wikipedia.org/wiki/Alfa\" title=\"Alfa\">alfa</a>. Dans les r&eacute;gions arides de l&#39;extr&ecirc;me sud, les&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Oasis\" title=\"Oasis\">oasis</a>&nbsp;sont plant&eacute;es de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Phoenix_dactylifera\" title=\"Phoenix dactylifera\">palmiers-dattiers</a>.</p>\r\n\r\n<p>Quinze aires naturelles ont &eacute;t&eacute; &eacute;rig&eacute;es en&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Parcs_nationaux_de_Tunisie\" title=\"Parcs nationaux de Tunisie\">parcs nationaux</a><a href=\"https://fr.wikipedia.org/wiki/Tunisie#cite_note-22\">22</a>. Le&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Parc_national_de_l%27Ichkeul\" title=\"Parc national de l\'Ichkeul\">parc national de l&#39;Ichkeul</a>, qui s&#39;&eacute;tend sur&nbsp;12&nbsp;600&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Hectare\" title=\"Hectare\">hectares</a>, est inscrit sur la liste du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Patrimoine_mondial\" title=\"Patrimoine mondial\">patrimoine mondial</a>&nbsp;de l&#39;<a href=\"https://fr.wikipedia.org/wiki/Organisation_des_Nations_unies_pour_l%27%C3%A9ducation,_la_science_et_la_culture\" title=\"Organisation des Nations unies pour l\'éducation, la science et la culture\">Unesco</a><a href=\"https://fr.wikipedia.org/wiki/Tunisie#cite_note-23\">23</a>. Il existe &eacute;galement seize r&eacute;serves naturelles qui ont pour but d&#39;&ecirc;tre un habitat pour des esp&egrave;ces ayant une valeur &eacute;cologique, &eacute;conomique et en tant qu&#39;<a href=\"https://fr.wikipedia.org/wiki/%C3%89cosyst%C3%A8me\" title=\"\">&eacute;cosyst&egrave;mes</a>&nbsp;vuln&eacute;rables.</p>\r\n\r\n<p>Selon une &eacute;tude du programme m&eacute;diterran&eacute;en du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/WWF\" title=\"WWF\">WWF</a>, la r&eacute;gion c&ocirc;ti&egrave;re du&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Nord-Ouest_tunisien\" title=\"Nord-Ouest tunisien\">nord-ouest</a>&nbsp;figure parmi les treize sites de la M&eacute;diterran&eacute;e qui se distinguent par leur richesse naturelle, leur&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Biodiversit%C3%A9\" title=\"Biodiversité\">biodiversit&eacute;</a>&nbsp;et leurs&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Esp%C3%A8ce\" title=\"Espèce\">esp&egrave;ces</a>&nbsp;v&eacute;g&eacute;tales et animales uniques.</p>\r\n\r\n<h3>G&eacute;ographie humaine</h3>', 2, 'question', '2020-04-02 08:47:50', 1);

