CREATE TABLE `projets` (
  `id_projet` int(11) NOT NULL,
  `ide_product_owner` int(11) DEFAULT NULL,
  `nom_projet` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `date_debut_projet` date DEFAULT NULL,
